/**
 * Popup window features.
 */
declare class PopupFeatures {
    x: number;
    x_set: boolean;
    y: number;
    y_set: boolean;
    width: number;
    width_set: boolean;
    height: number;
    height_set :boolean;
    menu_bar_visible: boolean;
    status_bar_visible: boolean;
    tool_bar_visible: boolean;
    scrollbars_visible: boolean;
}
